import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import Footer from '../Footer';

function ResearchProjects() {
  return (
    <>
    <h1 className='research'>Research Projects</h1>;
      <Cards />
      <Footer />
    </>
  );
}

export default ResearchProjects;

